import React, {useState, useEffect } from 'react'
import axios from 'axios';

const Code = () => {
    const [data,setData] = useState([])
    useEffect(()=>{
        try{
            axios.get("https://dummyjson.com/todos").then((Response)=>{
                console.log(Response.data.todos);
                setData(Response.data.todos);
                
            })
        }catch(error){
            console.log(error);
            
        }

    },[])
  return (
    <>
    <table border="2px">
        <thead>
            <tr>
            <th>UserId</th>
            <th>Task</th>
            <th>Status</th>
            </tr>
        </thead>

        <tbody>
            {data.map((item,index)=>(
                <tr key={index}>
                    <td>{index+1}</td>
                    <td>{item.userId}</td>
                    <td>{item.todo}</td>
                    <td>{item.completed?'true':'false'}</td>
                </tr>
            ))}
        </tbody>
    </table>
    </>
  )
}

export default Code
